import React from "react";
import "./style.css";

function FruitsCard({clickHandler, id, image, name}) {
  return (
    <div className="card">

        <img 
          alt={name} 
          src={image} 
          onClick={() => clickHandler(id)}
          />

    </div>
  );
}

export default FruitsCard;
